import React from "react";
import HeroIntroLanding from "./components/HeroIntroLanding";
import ScrollStoryHelix from "./components/ScrollStoryHelix";
import FloatingGallery from "./components/FloatingGallery";
import ContactEndSection from "./components/ContactEndSection";

function App() {
  return (
    <div style={{ width: "100vw", background: "black", overflow: "hidden" }}>
      <HeroIntroLanding />
      <ScrollStoryHelix />
      <FloatingGallery />
      <ContactEndSection />
    </div>
  );
}
export default App;
